import React from "react";

const FavoritCards = ({ likedCards }) => {
  return (
    <div className="bodyAbout">
      <h1>Favorite Cards</h1>
      {likedCards.length === 0 ? (
        <p>No favorite cards selected yet.</p>
      ) : (
        <ul>
          {likedCards.map((cardId) => (
             <li  key={cardId._id}>
             <img
              
               src={cardId.image.url}
               alt={cardId.image.alt}
             />
             <h2>{cardId.title}</h2>
             <p >{cardId.subtitle}</p>
             <p >{cardId.address.country}</p>
           </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default FavoritCards;
